import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Link,
  Route,
  Switch
} from 'react-router-dom';
import Main from './Main.js';

function App() {
  return (
    <div className="App">
      <Router>
        <nav id="nav">
          <div id="about-div" className="mr-auto">
            <Link to='/about'>
              <button className="btn btn-dark">About</button>
            </Link>
          </div>
          <div id="try-div" className="ml-auto">
            <Link to='/'>
              <button className="btn btn-dark">Try Now</button>
            </Link>
          </div>
        </nav>
        <div className="container mt-5">
          <h1 className="heading-2 text-center" id="title">Trace The Bug</h1>
        </div>
        <div className="container">

        </div>

        <Switch>
          <Route exact path="/">
            <Main />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
